    28, 2009, February 2, 2010, March 5, 2010, April 6, 2010, October 11, 2010, November
    19, 2010, March 22, 2011, September 8, 2011, January 30, 2012, June 8, 2012, August
    27, 2012, April 27, 2013, and November 22, 2013. This data set was provided by IDHS
    in ESRI feature class named "County_Parcels." This data set was compiled by IDHS
    as part of the IndianaMap Data Sharing Initiative between IGIC, Indiana Office of
    Technology (IOT), Indiana Geographic Information Office (GIO), Indiana Department
    of Homeland Security (IDHS), Indiana Geological Survey (IGS) and participating Indiana
    counties to provide the most accurate framework data (including address points,
